import React from 'react';
import { BrowserRouter as Router, Routes, Route, Link } from 'react-router-dom';
import AssetOverview from './AssetOverview';
import PipelineTransformation from './PipelineSimulation';

const App = () => {
    return (
        <Router>
            <div>
                <nav style={{ padding: '10px', marginBottom: '20px', background: '#f4f4f4' }}>
                    <Link to="/" style={{ marginRight: '10px' }}>Asset Overview</Link>
                    <Link to="/pipeline">Pipeline Transformation</Link>
                </nav>
                <Routes>
                    <Route path="/" element={<AssetOverview />} />
                    <Route path="/pipeline" element={<PipelineTransformation />} />
                </Routes>
            </div>
        </Router>
    );
};

export default App;
